import "../components/styles/Header.css"

export default function Header() {
    return (
        <nav>
            <div>
                <img src="https://static.wixstatic.com/media/2c3bc8_d6735c1490854461bc201286e87280ee~mv2.png/v1/fill/w_604,h_442,al_c,lg_1,q_85,usm_0.66_1.00_0.01,enc_auto/2c3bc8_d6735c1490854461bc201286e87280ee~mv2.png" alt="Rehoboth Evangelical Ethiopian Church logo"/>
                <h2>Rehoboth</h2>
                <p>Ethiopian Church</p>
            </div>
        </nav>
    )
}
